  \"peales-peregrine-falcon-falco-peregrinus-pealei-studies-in-alaska-june-12-24-1985\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Survey coverage for peregrines along the
  Alaska Coast has been incomplete and variable in intensity. The lack of trend data,
  increased development activity in Alaska and declines of falcon populations in neighboring
  British Columbia point to a need for better information on the Peale's peregrines
  of Alaska. Seabirds observed along the coastline were identified and numbers estimated.
  Observations of bald eagles and other birds are included.\",\n\t\"license_title\":
